const axios = require('axios');
const sleep = (ms) => new Promise(resolve => setTimeout(resolve, ms));

// ======================================
// 环境变量配置： DN_tk，值为 mobile#openId#unionId#token（多账号换行分隔）
// ======================================
const NOTIFY_CONFIG = {
    ENABLED: 1, // 0=关闭通知，1=开启通知
    PUSHPLUS_TOKEN: '' // 推送令牌（留空关闭）
};

/**
 * 发送通知函数
 * @param {string} message - 通知内容
 * @returns {boolean} 发送结果
 */
async function sendNotification(message) {
    if (!message || !NOTIFY_CONFIG.ENABLED || !NOTIFY_CONFIG.PUSHPLUS_TOKEN) return false;
    try {
        const accountMessages = {};
        let currentAccount = '';
        const lines = message.split('\n');
        
        for (const line of lines) {
            if (line.startsWith('账号')) {
                currentAccount = line.trim();
                accountMessages[currentAccount] = [];
            } else if (currentAccount && line.trim()) {
                accountMessages[currentAccount].push(line.trim());
            }
        }

        let formattedMsg = '';
        const accounts = Object.keys(accountMessages);
        for (let i = 0; i < accounts.length; i++) {
            const account = accounts[i];
            formattedMsg += `${account}\n`;
            formattedMsg += accountMessages[account].join('\n');
            if (i < accounts.length - 1) {
                formattedMsg += '\n------------------------------\n';
            }
        }

        const now = new Date();
        const timeStr = now.toLocaleString('zh-CN', { 
            year: 'numeric', month: '2-digit', day: '2-digit',
            hour: '2-digit', minute: '2-digit', second: '2-digit'
        });
        formattedMsg += `\n————————————\n执行时间：${timeStr}`;

        await axios.post('https://www.pushplus.plus/send', {
            token: NOTIFY_CONFIG.PUSHPLUS_TOKEN,
            title: '',
            content: formattedMsg,
            template: 'txt'
        });
        return true;
    } catch (e) {
        console.log(`通知发送异常: ${e.message}`);
        return false;
    }
}

